import React, { useState } from 'react';
import { generateText } from './huggingfaceService';

const HuggingFaceComponent = () => {
  const [prompt, setPrompt] = useState('');
  const [predictions, setPredictions] = useState([]);

  const handleInputChange = (event) => {
    setPrompt(event.target.value);
  };

  const handleGenerateText = async () => {
    try {
      const response = await generateText(prompt);
      setPredictions(response.choices.map((choice) => choice.text));
    } catch (error) {
      console.error('Error generating text:', error);
    }
  };

  return (
    <div>
      <input type="text" value={prompt} onChange={handleInputChange} />
      <button onClick={handleGenerateText}>Generate Text</button>
      <div>
        {predictions.map((prediction, index) => (
          <p key={index}>{prediction}</p>
        ))}
      </div>
    </div>
  );
};

export default HuggingFaceComponent;
